"use strict";app.component("seeaFormBuild",{template:"Build date:  {{$ctrl.date}}<br>{{$ctrl.diff}} ago<br>by {{$ctrl.user}}",bindings:{date:"@",user:"@"},controller:function(){this.$onInit=function(){var t=Math.abs((new Date).getTime()-new Date(this.date).getTime())/1e3,e=Math.floor(t/86400);t-=86400*e;var a=Math.floor(t/3600)%24;t-=3600*a;var r=Math.floor(t/60)%60;t-=60*r;var o=Math.floor(t%60);this.diff=e+" days, "+a+" hours, "+r+" minutes, "+o+" sec."}}});